	(6,'annotation','On title page (A1r) \'Ex Libris [Ihon] [Ir[e]] [Paris]','','[Auct. R.4.3]: Tan calf binding with gilt tooling and decoration, probably 18th century. Yellow fore edge with \'13 | 3\' in ink. Tiny amount of annotation in beginning of book, in pencil and ink, Greek, underlining. Historic shelfmark \'M.4.3. Art.\' on title page. [Auct. R.4.4]: Tan calf binding with gilt tooling and decoration, probably 18th century. Red spotted fore edge with \'Arch. Bod. D. 4.4\' inscribed in ink. Copiously annotated throughout, in two hands, both in ink, in Latin and Greek.','','','',8,19),
