	(16,'','','','All items (4,5,6) have leather roll ornament, with red speckled fore edge. In volume 1 the title page (*1r) has a thin section excised and restored. This may have been an inscription/provenance mark. Title page has Art. B 3.4 in ink.','','','',16,19),
	(17,'clean','','','Calf binding with gilt arms of Sir Robert Sidney, three fillets (one gilt, two blind). \'I\' in ink on fore edge.','Bound with the arms of Sir Robert Sidney','evidence of ties and chaining','Sir Robert Sidney',17,19),
