	(19,'clean','','','Limp vellum binding. Fore edge has \'A.4°.S.1. s.1\'.','','evidence of green silk ties','',19,19),
	(20,'annotation','','','A French sixteenth-century gold-tooled brown calf binding, bound in imitation of a Greek binding by Gommar Estienne; sewn onto four cords, pierced through the edges of beech boards; the visible edges of the boards are grooved; four sets of triple leather thongs, one each at the head and tail, and two at the fore-edge, are set into the lower board, pierced through it to form ties, now wanting, and fastened onto pins, now wanting, on the edge of the upper cover; gilt-edged leaves. Formerly chained in the Bodleian: staple-marks of a hasp at head of upper cover. On both covers a single gilt fillet forms a border and double gilt fillets form a frame; between border and frame the calf is tinted black; an arabesque centre-piece, containing the gilt initials \'I F\', probably for John Fortescue; the arabesque is made up of the following tools, as numbered in [Howard Nixon], Bookbindings from the Library of Jean Grolier: A Loan Exhibition 23 Sept.-31 Oct. 1965 (London, 1965): CP nos 53, 64a, 64b, 65a, 65b, and 69.  Gilded fore edge, \'17\' and \'7\' inscribed in ink. Shelfmarks inscribed as \'Art. E.1.7\', and \'Linc. B.3.7\' (both expunged). [Info from Bod-Inc].','','evidence of chaining','',20,19),
	(21,'clean','','','Volume 1 (Jur. B.1.8): tan calf binding with triple fillet. \'8\' on fore edge, with expunged (shelfmark?) reading \'[B.1.8]\'. Volume 2 (Jur. B.1.9): tan calf binding with triple fillet (binding coming loose). \'9\' on fore edge, with expunged shelfmark reading \'[B.1.9]\'. ','','evidence of ties and chaining','',21,25),
	(23,'clean','','','Tan calf binding with triple fillet around edge. On fore edge is \'4\' in ink, and a strange indented/stepped area running down the vertical edge. On pastedown is \'F.2.4. Jur.\' in ink.','','evidence of ties and chaining','',22,25),
	(24,'annotation; underlining; manicules','','','Volume 1 (Jur. C.6(4)): Tan calf binding with diagonal roll ornament within rectangular frame and double fillet. Fore edge has \'4\' along rubricated pages. Pastedown has \'C.6.4. Jur.\' in ink and \'C.6.6. Jur.\' in pencil. Volume 2 (Jur. C.6(5)): Tan calf binding with diagonal roll ornament within rectangular frame and double fillet.  Fore edge has \'5\' along rubricated pages. Pastedown has \'C.6.5\' Jur\'.\' in ink and \'C.6.4. Jur.\' in pencil. Volume 3 (Jur. C.6(6)): Tan calf binding with diagonal roll ornament and double fillet. Pastedown has \'C.6.6 Jur.\' in ink. Fore edge has \'6\' along rubricated pages.','','evidence of clasps, ties and chaining','',23,25),
	(25,'clean','','','Tan calf binding with diagonal rolled ornament within rectangular frame and double fillet.  Fore edge is rubricated, with \'2\' in ink.  Flyleaf (verso) has \'I.2.2.Jur.\' in ink, and pastedown has \'I.2.2 Jur in ink. Some ripping to interior pages and rear pages ripped completely at an angle. Identical binding to ID_25.','','evidence of ties and chaining','',24,25),
	(26,'clean','(On title page A1r) inscription  \'Es del licen[do?] herrera sin se de expurgat[.]\'','','Tan calf binding with diagonal rolled ornament within rectangular frame and double fillet. Fore edge is rubricated and has \'4\' in ink. Title page ( A1r) has \'D.3.4 Jur.\' and inscription \'Es del licen[do?] herrera sin se de expurgat[.]\'.  Identical binding to ID_24.','','evidence of ties and chaining','',25,25),
	(27,'annotation','(On title page A1r) \'George Multonj, Cant 1644 A 14.13 Th.; Selden\'s Greek inscription','','Vellum on board. \'X\' in ink on front board. \'[Cant] A 14.13 Th\' 1644\' inscribed on title page (A1r), \'Seld. 4 L. 5. Jur\' inked on the flyleaf (verso), and \'4° L 5 Jur Seld.\' on flyleaf (recto). \'5 Jur. Seld  R\' on the spine, and cream pasted label with \'E\'. ','','','[John Selden]; George Moulton',26,25),
