	(33,'unknown','(Volume 1: on flyleaf recto) \'Liber Joan Morrien\', (on pastedown) \'Gualterus [Hiurne]; (Volume 2: on flyleaf recto) \'Liber Joan Morrien\'','','Volume 1 (RR.X.217 (1): Limp vellum, gilded armorial stamp with initials RVO and gilded date stamp 1589. Old shelfmarks and the title (illegible) scramble at the base of the spine, on volume 1, 209 inked on, title formerly inscribed on top spine, date 1589. Bookplate on pastedown, with \'E. Bibl. Radcl.\', and \'RR.X.217 (1)\' in pencil; \'G.162. D.6\' in pencil; some numerals and digits in pencil expunged. Volume 2 (RR.X.217 (2)): Limp vellum, gilded armorial stamp with initials RVO and gilded date stamp 1589. Old shelfmarks and the title (impression remaining) at base of spine, with small pasted label at base. Bookplate on pastedown, with \'E. Bibl. Radcl.\', and \'RR.X.217 (2)\' in pencil; \'G.162. D.67 in pencil; some numerals and digits in pencil expunged.','','evidence of green silk ties','John Morrien',31,25),
