	(66,'unknown','(Rear pastedown) \'Liber generatione Liber genera Lo quo es y depoquo sa[p] el quest mate[r] porlo queropue set[p] in ink,; \'Ex Libris [.]\' in pencil','','Tan calf binding with frame of ornaments within diagonal rolled tooling. Fore edge has \'10\' in ink. Title page is cut at top, obscuring writing. Rear pastedown has \'Liber generatione | Liber genera | Lo quo es y depoquo sa[p] |el quest mate[r] | porlo queropue set[p] |\' in ink, and \'Ex Libris\' in pencil.','','','',60,17),
	(67,'annotation; underlining','','','Dark calf binding. Fore edge had inscription, now expunged. Some drawings (with added lift-the-flap drawings!). Flyleaf (verso) has inscription: \'This was turned out as a Dupl, by the order of the Curators replaced in the Library\', and \'C.1.18 Med. Seld.\' in ink. Title page (A1r) has C.1.18 Med Seld.\' in ink, and another inscription (about duplicate?) now expunged.','','evidence of ties and chaining','',61,17),
