	(70,'clean','inscription on title page washed.','','Dark calf binding with gilded centrepiece crest of Richard Eedes (donor to the library 1601, ID_32). Fore edge is red with \'17\' in ink (previously \'16\'?). Title page (A1r) has possible inscription [D.G...?] expunged. Spine suggests recent conservation.','','evidence of ties and chaining','',64,17),
	(71,'clean','(On title page A1r) \'[Paineterus] vjs iiijd\'.','','Tan calf binding with gilt centrepiece and double fillet. Fore edge is gilded and has \'II\', and \'2\'. Front pastedown is manuscript fragment (parchment?). Final pastedown has \'5s 4d\' in ink. Title page (A1r) has \'[Paineterus] vjs iiijd\'.','','evidence of ties and chaining','',65,17),
	(72,'annotation','(On title page A1r) \'[A] Scrafton et sus amigos\'','','Tan calf binding with crossed triple fillets and diagonal rolled ornament. Binding conserved (new spine). Flyleaf (recto) has expunged \'Art A.7.15.\' and \'A.4°.Z.3\'. Title page (*ir) has current shelfmark, \'[A] Scrafton et sus amigos\', and \'olim Art. A.7.15.\' Fore edge has red colouring and has large red dots, and \'15\', \'13\', \'A 4° Z 3\'.','','evidence of ties and chaining','',66,17),
	(73,'clean','','','Vol.1 (D 8 10 Art.): Dark calf binding with gilded centrepiece. Fore edge has \'10\' in ink. Flyleaf (verso) has \'olim G.11. Art.\' in ink. Title page (Jupiter symbol 1r) has \'1574 in red pencil\'. Vol.2 (D 8 12 Art.): Dark calf binding with gilt centrepiece. Fore edge has \'12\' in ink. Flyleaf (verso) has \'olim G.1.8. Art.\' in ink (proto-catalogues have G.1.1,2,3 Art.). Title page ([venus] symbol 1r) has \'1574\' in red pencil.','','evidence of ties and chaining','',67,17),
	(74,'annotation','','','Tan calf binding with fillets with vinicultural rolled ornament within rectangular frames and vertical strips. Book has metal reinforcement. Fore edge (blush colour, perhaps once red) has \'II\' and \'3\' in ink. Title page (*1r) has \'olim G.3.2 Art.\' in ink. ','','evidence of ties and chaining','',68,17),
	(75,'greek annotations throughout','','','Tan calf binding with gilt fillet around edges. Historic shelfmarks read on flyleaf (verso) \'Olim A.3.10 Art.\' and title page (¦1r) \'6.8.14 Art.\'. \'10\' and \'14\' on the fore edge.','','evidence of chaining, ties and clasps','',69,17),
	(76,'','','','Rebound 19th century, tan calf binding with gilt fillets and blind (rolled?) tooling. No mark on fore edge. Title page (1r) has \'St. Am. Cat no. 176\', and \'fo. S. Am. 97\'. ','','','',69,17),
	(77,'annotation; mathematical drawings','annotations in the hand of John Dee','','Calf, blind tooled triple fillet, \'69\' on fore edge, \'4\' inked on fore edge.  \'AA 69 Art\' on title page (A1r).','','evidence of ties and chaining','John Dee',70,17),
	(78,'annotation','','','Dark calf binding, stamped central motif, triple frames. \'olim CC1 Art\' \'DD 63 Art\' on title page (A1r), \'63\' and \'I\' inked on fore edge. Front pastedown comprises manuscript, with part of covering removed and MS shows through. Pastedown has \'DD 63 Art\'.','','evidence of clasps','',71,17),
