	(80,'annotation; marginalia; manicules','(On title page A1r) \'Henricii Stannfordij hund vendicat precium 4s\' ; \'Christoferus Cariens, 3 Septembris 1554\'','','Dark calf binding with triple fillets along the edges and lozenge with rolled ornament. Flyleaf seems to be a page from another printed book: the recto has: \'Christoferus Cariens, 3 septembris 1554\', and the verso has annotations as well. The title page (a1r) has \'Christoferus Cariens, die septembris 3° a° 1554\', \'M.1.11 Art\' , and \'olim C.8.11.Art\', and \'Henricii Staunfordij hunc vendicat p[re]cium 4s\' . The rear pastedown is printed material. Fore edge has \'II\' in ink.','','evidence of clasps and chaining','Henry Stanford; [Christopher Carey]',72,17),
